import React from 'react'
import { useGetShopsQuery} from '../api/api'


const Shop = ({shopId}) => {

    const { shop } = useGetShopsQuery('getShops', {
        selectFromResult: ({ data }) => ({
            shop: data?.entities[shopId]
        }),
    })

  return (
    <div>Shop</div>
  )
}

export default Shop
